// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

interface IERC20 {
    function transfer(address recipient, uint256 amount) external returns (bool);
}

interface IERC721 {
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) external;
}

interface IERC721Receiver {
    function onERC721Received(
        address operator,
        address from,
        uint256 tokenId,
        bytes calldata data
    ) external returns (bytes4);
}

contract AssetHandler is IERC721Receiver, ReentrancyGuard {
    event ReceivedETH(address indexed from, uint256 amount);
    event ReceivedERC721(address indexed from, address indexed token, uint256 tokenId);

    event TransferredETH(address indexed to, uint256 amount);
    event TransferredERC20(address indexed token, address indexed to, uint256 amount);
    event TransferredERC721(address indexed token, address indexed to, uint256 tokenId);

    // Receive ETH
    receive() external payable {
        emit ReceivedETH(msg.sender, msg.value);
    }

    // Handle ERC721 receipt
    function onERC721Received(
        address operator,
        address from,
        uint256 tokenId,
        bytes calldata data
    ) external override returns (bytes4) {
        // Silence unused parameter warnings
        operator; data;

        emit ReceivedERC721(from, msg.sender, tokenId);
        return this.onERC721Received.selector;
    }

    // Transfer ETH
    function transferETH(address payable to, uint256 amount) external nonReentrant {
        require(address(this).balance >= amount, "Insufficient balance");

        uint256 initialBalance = address(this).balance;
        to.transfer(amount);
        assert(address(this).balance == initialBalance - amount);

        emit TransferredETH(to, amount);
    }

    // Transfer ERC20 tokens
    function transferERC20(
        address token,
        address to,
        uint256 amount
    ) external {
        require(
            IERC20(token).transfer(to, amount),
            "ERC20 transfer failed"
        );
        emit TransferredERC20(token, to, amount);
    }

    // Transfer ERC721 tokens
    function transferERC721(
        address token,
        address to,
        uint256 tokenId
    ) external {
        IERC721(token).safeTransferFrom(address(this), to, tokenId);
        emit TransferredERC721(token, to, tokenId);
    }
}

